import React from "react";
import { Link } from "react-router-dom";

const navLinks = [
  {
    title: "Home",
    path: "/",
  },
  {
    title: "Blog",
    path: "/blog",
  },
  {
    title: "Contact Us",
    path: "/contact-us",
  },
  {
    title: "Login",
    path: "/login",
  },
];

const Navigation = () => {
  return (
    <nav className="site-navigation">
      <span>Stalic"s blog</span>
      <ul></ul>
    </nav>
  );
};

export default Navigation;
